					["custom"] = "----------------------------\n-- Print stacks achieved at \n-- the end of kingsbane?\naura_env.printStacks = true\n----------------------------\n-- Spell IDs\naura_env.ago    = 200803\naura_env.kings  = 192759\naura_env.deadly = 2818\naura_env.deadlydmg = 113780\n----------------------------\n-- Aura Information \naura_env.active = nil\naura_env.start  = nil\naura_env.poison = nil\naura_env.dest   = nil\naura_env.stacks = 0\naura_env.capped = false\naura_env.prev = nil\naura_env.curr = nil\n----------------------------\n-- Function Clones\naura_env.getTime = GetTime\naura_env.print = print\naura_env.guid = UnitGUID\n----------------------------\n-- Custom Functions\naura_env.getPoison = function()\n    local agonizing = UnitBuff(\"player\", GetSpellInfo(aura_env.ago))\n    --aura_env.message(\"aura_env.poison set to: [\"..(agonizing and \"Agonizing Poison\" or \"Deadly Poison\")..\"]\")\n    return agonizing and aura_env.ago or aura_env.deadly    \nend\naura_env.shift = function(exp)\n    aura_env.prev = aura_env.curr\n    aura_env.curr = exp\nend\naura_env.increment = function()\n    aura_env.stacks = aura_env.stacks + 1\n    aura_env.message(\"stacks incremented to \"..aura_env.stacks)\nend\naura_env.resetStacks = function()\n    aura_env.stacks = 0\n    aura_env.message(\"stacks reset to 0\")\nend\naura_env.set = function(dest)\n    aura_env.active = true\n    aura_env.start = aura_env.getTime()\n    aura_env.dest = dest\n    aura_env.message(\"variables set: {true, \"..dest..\", \"..aura_env.start..\"}\")\nend\naura_env.reset = function()\n    aura_env.active = nil\n    aura_env.start = nil\n    aura_env.dest = nil\n    aura_env.capped = false\n    aura_env.prev = nil\n    aura_env.curr = nil\n    aura_env.resetStacks()\n    aura_env.message(\"variables reset\")\nend\naura_env.message = function(...)\n    if aura_env.debug then\n        print(...)\n    end\nend\n----------------------------\n-- Misc\naura_env.debug = false",
