						["custom"] = "function(event, ...)\n    \n    \n    local wa_stealthed = UnitBuff(\"player\", GetSpellInfo(1784), nil, \"PLAYER|HELPFUL\")\n    local wa_vanishing = UnitBuff(\"player\", GetSpellInfo(11327), nil, \"PLAYER|HELPFUL\")\n    wa_stealthend = wa_stealthend or 0\n    wa_stealthtime = wa_stealthtime or GetTime()\n    wa_vanished = wa_vanished or 0\n    wa_vanish_time = wa_vanish_time or GetTime()\n    wa_stealth = wa_stealth or false\n    \n    if wa_stealthend then\n        \n        wa_stealthtime = GetTime() - wa_stealthend\n    end\n    \n    if wa_vanished then\n        \n        wa_vanish_time = GetTime() - wa_vanished\n    end\n    \n    \n    if (wa_stealthed or wa_vanishing or wa_stealthtime < 0.2 or hasVanish == true or wa_vanish_time < 0.3) then\n        \n        wa_stealth = true\n    else\n        wa_stealth = false\n    end\n    \n    local subevent2 = select(2, ...)\n    local sourceGUID2 = select(4, ...)\n    local spellName2 = select(13, ...)\n    \n    if(sourceGUID2 == UnitGUID(\"player\") and subevent2 == \"SPELL_AURA_REMOVED\") then\n        \n        if(spellName2 == GetSpellInfo(1784)) then\n            \n            wa_stealthend = GetTime()\n        end\n    end\n    \n    local subevent3 = select(2, ...)\n    local sourceGUID3 = select(4, ...)\n    local spellName3 = select(13, ...)\n    \n    if(sourceGUID3 == UnitGUID(\"player\") and subevent3 == \"SPELL_CAST_SUCCESS\") then\n        \n        if(spellName3 == GetSpellInfo(11327)) then\n            \n            wa_vanished = GetTime()\n            \n        end\n    end\n    \n    local subevent = select(2, ...)\n    local sourceGUID = select(4, ...)\n    local spellName = select(13, ...)\n    \n    if(sourceGUID == UnitGUID(\"player\") and subevent == \"SPELL_CAST_SUCCESS\") then\n        \n        if(spellName == GetSpellInfo(1943)) then\n            \n            \n            wa_RPsnapshot = false\n            \n            local wa_nightstalker = select(4, GetTalentInfo(2, 1, 1, nil, \"player\"))\n            \n            if (wa_nightstalker == true) then\n                \n                \n                if (wa_stealth == true) then\n                    \n                    wa_RPsnapshot = true\n                end\n                \n                \n            end\n        end\n        \n    end\n    \n    \n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
